window.bookSummaryJSON = "<p><b>\"A skillful narration of this story, especially its humor, makes this a fun and enjoyable performance.\" —</b><b><i>AudioFile</i></b><b> on </b><b><i>Can't Spell Treason Without Tea</i></b></p> <p><b><i>The Princess Bride </i></b><b>meets </b><b><i>Bookshops and Bonedust</i></b><b> in the third audiobook of the Tomes &amp; Tea series, where our favorite lesbian pirates must navigate the ultimate maelstrom—their own wedding!</b></p> <p>Kianthe and Reyna are ready to finally walk down the aisle—in just seven days, their wedding of a wifetime will be a reality. There's loads to do—but like all best laid plans, everything seems to be going awry.</p> <p>Between their baby dragons causing mayhem in Tawney, Kianthe's uptight parents inviting themselves to the wedding, and Reyna becoming embroiled in a secret plot to overthrow Queen Tilaine, the world seems against them—how are they going to live long enough to say \"I do\"?</p> <p><b>A Macmillan Audio production from Bramble Books.</b></p>"; 
